import { Injectable } from "@angular/core";

@Injectable()
export abstract class INumberEqualService{
    abstract IsEqual(number: number): boolean;
}

@Injectable()
export abstract class INumberEqualCondition 
{
  abstract IsEqual(number: number): boolean;
}

@Injectable({ providedIn: 'root', multi: true })
export class NumberIsEven implements INumberEqualCondition
{
    public IsEqual(number: number): boolean {
        return number % 2 == 0;
    }
}
